class Solution(object):
	def __init__(self):
		self.result = []
	def help(self,s,words,begin):
		wordl = len(words[0])
		mydict = {}
		for i in words:
			if i in mydict:
				mydict[i]+=1
			else:
				mydict[i] = 1
		l = 0
		r = 0
		while(r+wordl-1<len(s)):
			cur = s[r:(r+wordl)]
			#print cur
			if cur not in mydict:
				if l!=r:
					for i in words:
						mydict[i] = 0
					for i in words:
						mydict[i] +=1
				l = r+wordl
				r = l
			elif mydict[cur]==0:
				left = s[l:(l+wordl)]
				mydict[left]+=1
				l += wordl
			else:
				mydict[cur]-=1
				r += wordl
				if r-l==len(words)*wordl:
					self.result.append(l+begin)
					left = s[l:(l+wordl)]
					mydict[left]+=1
					l += wordl
	def findSubstring(self,s,words):
		l = len(words[0])
		if(len(s)<len(words)*len(words[0])):
			return self.result
		for i in range(l):
			self.help(s[i:],words,i)
		return self.result

